const React=require("react");

function Education(props){
    return(
        <div className="edu">
        <img className="pic2" src={props.picture}></img>
        <h4 className="heading2">{props.heading}</h4>
        <h2 className="title2">{props.title}</h2>
        <p className="text">{props.text}</p>
        <h3 className="name2">{props.name}</h3>
        <img className="pp2" src={props.pp}></img><h4 className="views2">{props.views}</h4>
    </div>);
}

export default Education;
